Venue.scraper_aux:
{
  repeat => [
    [qr{((?:[^\n]+\n)+)\w+,\s*$month\s+$day,\s+$year,\s+$time_ap.*?\n\n((?:[^\n]+\n)+)\n}s, {
      fields => [qw(summary month day year start_time description)],
    }],
  ],
}

{
    repeat => [
	[qr{^$month_day\s+(.*?)\s*$}m, {
	    fields => [qw(month_day summary)],
	    follow_link => {
		global => [
		    [qr{\bshow\:\s*$time_ap}i, {
			fields => ['start_time'],
		    }],
		    [qr{about this show.*?\n+(.*?)\n}is, {
			fields => ['description'],
		    }],
		],
	    }
	}],
    ],
}

{
    repeat => [
	[qr/($month\s*>.*)/, {
	    fields => ['link'],
	    follow_link => {
		global => [
		    [qr/$month\s+$year/, {
			fields => ['month', 'year'],
		    }],
		],
		repeat => [
		    [qr/\n$day\s+$time\s*\-\s*$time\s(.*?)(\n$day\n|\nGathering Place)/s, {
			fields => ['day', 'start_time_pm', 'end_time_pm',
			    'description', 'save'],
			summary_from_description =>
			    qr/(?:^|\n)([^\n]+\{\d+\})\n/s,
		    }],
		],
	    },
	}],
    ],
}

{
  pager => {
    link => qr/\n(>>\{\d})\n/s,
    page_count => 3,
  },
  repeat => [
    [qr/$time_ap\s*\-\s*\nCLOSED/s => {
      fields => [],
    }],
    [qr/$time_ap\s*\-\s*\n$line/s => {
      fields => [qw(start_time summary)],
      follow_link => {
        global => [
          [qr/$month $day, $year/ => {
              fields => [qw(month day year)],
          }],
          [qr/description\: (.*?)\n\n/is => {
            fields => [qw(description)],
          }],
        ],
      },
    }],
  ],
}
